import react from "react";
import { Navbar, Container, Nav, NavDropdown } from "react-bootstrap";
function Home() {
  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="#home">Touch-Dashboard</Navbar.Brand>
        <div
          style={{
            border: "white solid 1px",
            borderRadius: "100px",
            widows: "60px",
            height: "40px",
          }}
        >
          <img src="./assets/icons/bell.svg" fill="white" width={20} />
        </div>
      </Container>
    </Navbar>
  );
}

export default Home;
